import React from "react";
import "../styles/About.css";
const About = () => {
  return(
  <div className="about-text">
    This is a web app using the Yelp Api and the Google Maps Api for our Web development class. When the user inputs a restaurant and clicks search, the nearest restaurants
    will show up. Although it is not perfect, there is functionality to it, and we hope to add more features as time goes on!
  </div>
  )
};

export default About;
